import React from 'react';
import { createMuiTheme, withStyles, makeStyles, ThemeProvider } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { green, blue, purple } from '@material-ui/core/colors';
import ButtonBase from '@material-ui/core/ButtonBase';
import Avatar from '@material-ui/core/Avatar';
import Noteworthy from '/assets/fonts/Noteworthy-Lt.woff';

const noteworthy = {
  fontFamily: 'Noteworthy',
  fontStyle: 'normal',
  fontDisplay: 'swap',
  fontWeight: 400,
  src: `
    local('Noteworthy'),
    url(${Noteworthy}) format('woff')
  `,
  unicodeRange:
    'U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF',
};



const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    color: "black",
    marginLeft: 10,
  },
  image: {
    height: 50,
    width:50
  }
}));

const image =
  {
    url: '/assets/H2R.png',
    title: 'Breakfast',
    width: '100%',
  }

  const theme = createMuiTheme({
    typography: {
      fontFamily: 'Noteworthy, Arial',
    },
    overrides: {
      MuiCssBaseline: {
        '@global': {
          '@font-face': [raleway],
        },
      },
    },
  });

export default function NavBar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" style={{ background: "#ffffff" }}>
        <Toolbar>
          <Button>
            <Avatar variant="square" src="/assets/H2R.png" className={classes.image} />
          </Button>
          <ThemeProvider theme={theme}>
          <CssBaseline />
          <Typography variant="h6" className={classes.title}>
            How2React
          </Typography>
           </ThemeProvider>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
    </div>
  );
}
